import React from 'react'
import MainWelcome from './MainWelcome'
import MainPieChart from './MainPieChart'
import MainBarChart from './MainBarChart'
import MainBreakDown from './MainBreakDown'

class Main extends React.Component{
	render(){
		return(
		<div className='main'>
            <MainWelcome name={this.props.name} />
            <MainPieChart pieChartData={this.props.pieChartData}  />
            <MainBreakDown />
            <MainBarChart barChartData={this.props.barChartData} />
		</div>
		)
	}
}

export default Main
